INSERT INTO `ls_system_setting` VALUES (201, 'https://mojin.51wangshi.com/', '商城', 'http://images.lecshop.cn/20190626/1561517476715.jpg', '//images.lecshop.cn/20190626/1561517471744.jpg', 'http://images.lecshop.cn/20190626/1561517487296.jpg', NULL, '', NULL, '2018 © LecShop.', '<h4 style=\"color: #000000; font-size: 12px; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">用户注册协议</span></h4>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">本协议是您与网站(简称\"本站\"，网址：www.XXXX.com）所有者（以下简称为\"\"）之间就网站服务等相关事宜所订立的契约，请您仔细阅读本注册协议，您点击\"同意并继续\"按钮后，本协议即构成对双方有约束力的法律文件。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第1条 本站服务条款的确认和接纳</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">1.1本站的各项电子服务的所有权和运作权归所有。用户同意所有注册协议条款并完成注册程序，才能成为本站的正式用户。用户确认：本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别约定的，依其规定。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">1.2用户点击同意本协议的，即视为用户确认自己具有享受本站服务、下单购物等相应的权利能力和行为能力，能够独立承担法律责任。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">1.3如果您在18周岁以下，您只能在父母或监护人的监护参与下才能使用本站。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">1.4保留在中华人民共和国大陆地区法施行之法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容或取消订单的权利。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第2条 本站服务</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">2.1通过互联网依法为用户提供互联网信息等服务，用户在完全同意本协议及本站规定的情况下，方有权使用本站的相关服务。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">2.2用户必须自行准备如下设备和承担如下开支：（1）上网设备，包括并不限于电脑或者其他上网终端、调制解调器及其他必备的上网装置；（2）上网开支，包括并不限于网络接入费、上网设备租用费、手机流量费等。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第3条 用户信息</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.1用户应自行诚信向本站提供注册资料，用户同意其提供的注册资料真实、准确、完整、合法有效，用户注册资料如有变动的，应及时更新其注册资料。如果用户提供的注册资料不合法、不真实、不准确、不详尽的，用户需承担因此引起的相应责任及后果，并且保留终止用户使用各项服务的权利。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.2用户在本站进行浏览、下单购物等活动时，涉及用户真实姓名/名称、通信地址、联系电话、电子邮箱等隐私信息的，本站将予以严格保密，除非得到用户的授权或法律另有规定，本站不会向外界披露用户隐私信息。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.3用户注册成功后，将产生用户名和密码等账户信息，您可以根据本站规定改变您的密码。用户应谨慎合理的保存、使用其用户名和密码。用户若发现任何非法使用用户账号或存在安全漏洞的情况，请立即通知本站并向公安机关报案。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.4用户同意，拥有通过邮件、短信电话等形式，向在本站注册、购物用户、收货人发送订单信息、促销活动等告知信息的权利。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.5用户不得将在本站注册获得的账户借给他人使用，否则用户应承担由此产生的全部责任，并与实际使用人承担连带责任。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.6用户同意，有权使用用户的注册信息、用户名、密码等信息，登录进入用户的注册账户，进行证据保全，包括但不限于公证、见证等。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第4条 用户依法言行义务</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">本协议依据国家相关法律法规规章制定，用户同意严格遵守以下义务：</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（1）不得传输或发表：煽动抗拒、破坏宪法和法律、行政法规实施的言论，煽动颠覆国家政权，推翻社会主义制度的言论，煽动分裂国家、破坏国家统一的的言论，煽动民族仇恨、民族歧视、破坏民族团结的言论；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（2）从中国大陆向境外传输资料信息时必须符合中国有关法规；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（3）不得利用本站从事洗钱、窃取商业秘密、窃取个人信息等违法犯罪活动；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（4）不得干扰本站的正常运转，不得侵入本站及国家计算机信息系统；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（5）不得传输或发表任何违法犯罪的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、伤害性的、庸俗的，淫秽的、不文明的等信息资料；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（6）不得传输或发表损害国家社会公共利益和涉及国家安全的信息资料或言论；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（7）不得教唆他人从事本条所禁止的行为；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（8）不得利用在本站注册的账户进行牟利性经营活动；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（9）不得发布任何侵犯他人著作权、商标权等知识产权或合法权利的内容；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">用户应不时关注并遵守本站不时公布或修改的各类合法规则规定。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">本站保有删除站内各类不符合法律政策或不真实的信息内容而无须通知用户的权利。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">若用户未遵守以上规定的，本站有权作出独立判断并采取暂停或关闭用户帐号等措施。用户须对自己在网上的言论和行为承担法律责任。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第5条 商品信息</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">本站上的商品价格、数量、是否有货等商品信息随时都有可能发生变动，本站不作特别通知。由于网站上商品信息的数量极其庞大，虽然本站会尽最大努力保证您所浏览商品信息的准确性，但由于众所周知的互联网技术因素等客观原因存在，本站网页显示的信息可能会有一定的滞后性或差错，对此情形您知悉并理解；欢迎纠错，并会视情况给予纠错者一定的奖励。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">为表述便利，商品和服务简称为\"商品\"或\"货物\"。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第6条 订单</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">6.1在您下订单时，请您仔细确认所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与用户本人不一致的，收货人的行为和意思表示视为用户的行为和意思表示，用户应对收货人的行为及意思表示的法律后果承担连带责任。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">6.2除法律另有强制性规定外，双方约定如下：本站上销售方展示的商品和价格等信息仅仅是要约邀请，您下单时须填写您希望购买的商品数量、价款及支付方式、收货人、联系方式、收货地址（合同履行地点）、合同履行方式等内容；系统生成的订单信息是计算机信息系统根据您填写的内容自动生成的数据，仅是您向销售方发出的合同要约；销售方收到您的订单信息后，只有在销售方将您在订单中订购的商品从仓库实际直接向您发出时（ 以商品出库为标志），方视为您与销售方之间就实际直接向您发出的商品建立了合同关系；如果您在一份订单里订购了多种商品并且销售方只给您发出了部分商品时，您与销售方之间仅就实际直接向您发出的商品建立了合同关系；只有在销售方实际直接向您发出了订单中订购的其他商品时，您和销售方之间就订单中该其他已实际直接向您发出的商品才成立合同关系。您可以随时登录您在本站注册的账户，查询您的订单状态。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">6.3由于市场变化及各种以合理商业努力难以控制的因素的影响，本站无法保证您提交的订单信息中希望购买的商品都会有货；如您拟购买的商品，发生缺货，您有权取消订单。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第7条 配送</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">7.1销售方将会把商品（货物）送到您所指定的收货地址，所有在本站上列出的送货时间为参考时间，参考时间的计算是根据库存状况、正常的处理过程和送货时间、送货地点的基础上估计得出的。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">7.2因如下情况造成订单延迟或无法配送等，销售方不承担延迟配送的责任：</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（1）用户提供的信息错误、地址不详细等原因导致的；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（2）货物送达后无人签收，导致无法配送或延迟配送的；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（3）情势变更因素导致的；</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（4）不可抗力因素导致的，例如：自然灾害、交通戒严、突发战争等。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第8条 所有权及知识产权条款</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.1用户一旦接受本协议，即表明该用户主动将其在任何时间段在本站发表的任何形式的信息内容（包括但不限于客户评价、客户咨询、各类话题文章等信息内容）的财产性权利等任何可转让的权利，如著作权财产权（包括并不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利），全部独家且不可撤销地转让给所有，用户同意有权就任何主体侵权而单独提起诉讼。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.2本协议已经构成《中华人民共和国著作权法》第二十五条（条文序号依照2011年版著作权法确定）及相关法律规定的著作财产权等权利转让书面协议，其效力及于用户在网站上发布的任何受著作权法保护的作品内容，无论该等内容形成于本协议订立前还是本协议订立后。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.3用户同意并已充分了解本协议的条款，承诺不将已发表于本站的信息，以任何形式发布或授权其它主体以任何方式使用（包括但限于在各类网站、媒体上使用）。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.4是本站的制作者,拥有此网站内容及资源的著作权等合法权利,受国家法律保护,有权不时地对本协议及本站的内容进行修改，并在本站张贴，无须另行通知用户。在法律允许的最大限度范围内，对本协议及本站内容拥有解释权。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.5除法律另有强制性规定外，未经明确的特别书面许可,任何单位或个人不得以任何方式非法地全部或部分复制、转载、引用、链接、抓取或以其他方式使用本站的信息内容，否则，有权追究其法律责任。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">8.6本站所刊登的资料信息（诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件），均是或其内容提供者的财产，受中国和国际版权法的保护。本站上所有内容的汇编是的排他财产，受中国和国际版权法的保护。本站上所有软件都是或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第9条 责任限制及不承诺担保</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">除非另有明确的书面说明,本站及其所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务，均是在\"按现状\"和\"按现有\"的基础上提供的。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">除非另有明确的书面说明,不对本站的运营及其包含在本网站上的信息、内容、材料、产品（包括软件）或服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的以外）。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">不担保本站所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务、其服务器或从本站发出的电子信件、信息没有病毒或其他有害成分。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">如因不可抗力或其它本站无法控制的原因使本站销售系统崩溃或无法正常使用导致网上交易无法完成或丢失有关的信息、记录等，会合理地尽力协助处理善后事宜。</span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第10条 协议更新及用户关注义务</span></h5>\n<p><span style=\"font-family: 微软雅黑, sans-serif;\"><span style=\"color: #000000; line-height: 16px;\">根据国家法律法规变化及网站运营需要，有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在本站上即生效，并代替原来的协议。用户可随时登录查阅最新协议；</span><strong style=\"color: #000000; line-height: 16px;\"><em>用户有义务不时关注并阅读最新版的协议及网站公告。如用户不同意更新后的协议，可以且应立即停止接受网站依据本协议提供的服务；如用户继续使用本网站提供的服务的，即视为同意更新后的协议。建议您在使用本站之前阅读本协议及本站的公告。</em></strong><span style=\"color: #000000; line-height: 16px;\">&nbsp;</span><span style=\"color: #000000; line-height: 16px;\">如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。</span></span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第11条 法律管辖和适用</span></h5>\n<p><span style=\"font-family: 微软雅黑, sans-serif;\"><span style=\"color: #000000; line-height: 16px;\">本协议的订立、执行和解释及争议的解决均应适用在中华人民共和国大陆地区适用之有效法律（但不包括其冲突法规则）。 如发生本协议与适用之法律相抵触时，则这些条款将完全按法律规定重新解释，而其它有效条款继续有效。 如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向有管辖权的中华人民共和国大陆地区法院提起诉讼。</span></span></p>\n<h5 style=\"color: #000000;\"><span style=\"font-family: 微软雅黑, sans-serif;\">第12条 其他</span></h5>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">12.1网站所有者是指在政府部门依法许可或备案的网站经营主体。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">12.2尊重用户和消费者的合法权利，本协议及本网站上发布的各类规则、声明等其他内容，均是为了更好的、更加便利的为用户和消费者提供服务。本站欢迎用户和社会各界提出意见和建议，将虚心接受并适时修改本协议及本站上的各类规则。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">12.3本协议内容中以黑体、加粗、下划线、斜体等方式显著标识的条款，请用户着重阅读。</span></p>\n<p style=\"word-wrap: break-word; margin-top: 5px; margin-bottom: 5px; color: #000000; line-height: 16px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">12.4您点击本协议下方的\"同意并继续\"按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。</span></p>\n<div>&nbsp;</div>', NULL, '<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">本协议由缔约双方在自愿、平等、公平及诚实信用原则的基础上，根据《中华人民共和国合同法》等相关法律、法规的规定。本协议由协议正文、附件及依据本协议公示于&ldquo; mojin<span lang=\"EN-US\">.cn</span>&rdquo;开放平台（以下简称&ldquo;平台&rdquo;）的各项规则所组成，协议附件及规则与本协议具有同等法律效力，如规则与本协议约定不一致的，以公布生效日期或签署日期在后的文件为准执行。本协议各条的标题仅为方便阅读而设，无意成为本协议的一部分，也不影响本协议的含义或解释。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;</span><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第一条<span lang=\"EN-US\">&nbsp;</span>相关定义及解释</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">北京魔金世纪贸易有限公司及其旗下子公司、分公司、分支机构或相关关联公司统称为&ldquo;&rdquo;，本协议中提及的应由甲方或&ldquo;魔金&rdquo;行使的权利和履行的义务，由&ldquo;魔金&rdquo;内部负责相应区域及业务范围的公司分别履行。本协议由北京魔金世纪贸易有限公司代表&ldquo;魔金&rdquo;与乙方签署。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;网站：指由&ldquo;魔金&rdquo;提供技术支持和服务的域名为<span lang=\"EN-US\">&nbsp;Lecshop.cn&nbsp;</span>的网站。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">魔金平台：指运行于&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;网站的&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;开放平台，是&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;网站上为用户提供信息发布、交流，第三方经营者开设店铺经营，以及其他技术服务的电子商务交易服务平台。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">1.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;网站用户：指所有在&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;网站上注册成为&ldquo;魔金 mojin<span lang=\"EN-US\">.cn</span>&rdquo;注册会员的法人、自然人及其他组织，本协议中统称为&ldquo;用户&rdquo;，除非另有说明，否则&ldquo;用户&rdquo;均指此含义。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">商家注册及入驻：商家注册指欲成为&ldquo;魔金平台&rdquo;第三方经营者的商家（本文或称&ldquo;卖家&rdquo;），依据&ldquo;京东平台&rdquo;入驻流程和要求完成在线信息提交，经&ldquo;魔金&rdquo;审核同意后，商家可以使用其自行设定的京东平台用户名和密码登陆&ldquo;魔金平台&rdquo;，以开立店铺开展经营；商家入驻，亦称&ldquo;店铺入驻&rdquo;指第三方<span lang=\"EN-US\">&nbsp;</span>经营者完成商家注册，通过资质审核且满足本协议第四条店铺服务开通条件后成为&ldquo;魔金平台&rdquo;第三方经营者的过程；本协议中的商家指本协议缔约方中的&ldquo;乙方&rdquo;。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">魔金平台用户名：亦称&ldquo;店铺用户名&rdquo;，是指商家完成商家注册后获取的与自设密码共同使用以登陆&ldquo;京东平台&rdquo;商家管理系统，使用&ldquo;魔金平台&rdquo;店铺服务的登陆账户，每一个魔金平台用户名对应一个店铺。商家应妥善保管店铺用户名及密码信息，不得擅自转让或授权他人使用。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">店铺：商家在完成商家注册及商家入驻流程后，为进行合法经营，依据协议约定和魔金平台规则由乙方申请，&ldquo;魔金&rdquo;审核通过的具有独立且唯一性<span lang=\"EN-US\">&nbsp;ID</span>（英文<span lang=\"EN-US\">&nbsp;IDentity&nbsp;</span>的缩写，意为&ldquo;身份标识号码&rdquo;）、特定名称（可依据相关平台规则进行调整）的网络化虚拟商铺，乙方可依据经营需要，开设一个或多个店铺。乙方通过魔金平台用户名可以实现对该店铺的管理，包括但不仅限于商品信息上传、修改、删除处理，交易跟踪、取消等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">魔金平台规则：指标示在&ldquo;魔金平台&rdquo;之上的，与商家经营有关的任何规范性文件，包括但不限于卖家手册、卖家后台公告、卖家后台帮助中心等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.9&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证金：商家向&ldquo;魔金&rdquo;缴纳的用以保证本协议履行及对商品和服务质量进行担保的金额，&ldquo;魔金&rdquo;可以依照本协议的相关约定对其进行处置</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.10&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">平台使用费：商家使用&ldquo;魔金平台&rdquo;各项服务时按照本协议约定缴纳的固定技术服务费用。具体缴纳标准见本协议附件。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.11&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">技术服务费：商家根据经营类目在达成每一单交易时按比例向&ldquo;魔金&rdquo;缴纳的技术服务费用，具体缴纳标准及方式见本协议附件。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span lang=\"EN-US\" style=\"font-family: 微软雅黑, sans-serif;\">&nbsp;</span></strong><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第二条<span lang=\"EN-US\">&nbsp;</span>服务内容及乙方店铺经营方式</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方依照本协议第四条约定为乙方开通店铺服务后，乙方可使用&ldquo;魔金平台&rdquo;发布商品信息，与愿意购买乙方商品的甲方其他用户进行在线交流，订立买卖合同，并向通过&ldquo;魔金平台&rdquo;购买其商品的用户提供售后服务，同时可参与&ldquo;魔金平台&rdquo;相关活动及使用&ldquo;魔金平台&rdquo;同意提供的其他有偿服务。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">除上述服务内容外，乙方可使用本协议附件列明的其他甲方提供的有偿服务，具体服务内容以本协议附件约定或双方另行签署（含乙方同意相关有偿服务的电子协议等以数据电文形式签署）的文件约定为准。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方店铺经营方式：乙方店铺内商品，均以乙方自身名义进行商品信息上传、展示、咨询答复、商品销售、发票开具、物流配送服务及售后服务提供等；乙方销售及服务出现争议、纠纷、国家机关机构调查时，由乙方以销售者身份处理。&ldquo;魔金&rdquo;不参与乙方店铺的经营中，除依据本协议相关约定外，也</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">不直接介入乙方与其他人间的争议和纠纷。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第三条<span lang=\"EN-US\">&nbsp;</span>入驻条件及证明文件提交</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;3.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">入驻条件乙方申请成为&ldquo;魔金平台&rdquo;入驻商家，在&ldquo;魔金平台&rdquo;开展经营活动，须满足以下条件：</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已依照中华人民共和国法律注册并领取合法有效的营业执照及其他经营许可；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方申请经营的商品来源合法，资质齐全；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意本协议及魔金平台相关规则。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">证明文件提交</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方须根据魔金平台相关规则及要求向甲方提交证明文件或其他相关证明，包括但不限于营业执照、税务登记证、授权委托书、商标注册证、质检报告、报关单、检验检疫证书、产品来源地证明等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方保证向甲方提供的上述证明文件或其他相关证明真实、合法、准确、有效，并保证上述证明文件或其他相关证明发生任何变更或更新时，及时通知甲方，若上述文件变更或更新导致乙方不符合本协议所规定入驻条件的，甲方有权单方全部或部分限制乙方经营，直至终止本协议。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方对其提交的证明文件或其他相应证明的真实性、合法性、准确性、有效性承担全部法律责任，若因乙方提交虚假、过期文件或未及时更新或通知证明文件导致纠纷或被相关国家机关处罚的，由乙方独立承担全部法律责任，如因此造成魔金（包括&ldquo;魔金&rdquo;合作方、代理人或职员）损失的，乙方应予以赔偿。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第四条<span lang=\"EN-US\">&nbsp;</span>店铺服务开通及停止</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">对于乙方拟开展经营的特定店铺，甲方在乙方提出开店申请并满足以下条件后<span lang=\"EN-US\">&nbsp;7&nbsp;</span>个工作日内为乙方开通服务，甲方将在服务正式开通前一个工作日以邮件方式通知乙方。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照本协议附件《乙方信息确认表》或者其他补充协议（若有）中确定的金额足额缴纳保证金；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照本协议及魔金平台相关规则提交证明文件或其他相关证明并已通过甲方审核；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已注册成为魔金平台用户且本协议已签署生效；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照附件《店铺信息表》或相关补充协议（若有）足额缴纳特定店铺相应服务期的平台使用费。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方为乙方开通服务后，乙方可利用魔金平台用户名及自设密码登陆商家后台，根据魔金平台相关规则及流程向乙方特定店铺上传、发布商品信息，与用户交流达成交易，使用本协议约定的其他有偿服务等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方店铺服务的停止：</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">4.3.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方需要停止店铺服务的，应至少提前七个工作日向甲方提出申请，经甲方审核同意后由甲方停止该店铺的服务功能；为弥补甲方已投入的人力、物力和技术支持，乙方同意甲方不退还该店铺未到期部分对应的平台使用费；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">出现以下任一情形时，甲方有权随时停止乙方相关店铺的服务；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方不满足入驻条件的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方提供虚假资质文件的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方未完成承诺销售额的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方产品价格、规格等信息标示错误，导致行政处罚、争议和纠纷的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方产品质量、标识不合格的，或者产品涉嫌走私、假冒伪劣、旧货、返修品的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">未经甲方事先审核产品品牌，而上传某品牌商品的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方连续<span lang=\"EN-US\">&nbsp;30</span>（三十）日或累计<span lang=\"EN-US\">&nbsp;45</span>（四十五）日未正常经营店铺的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">其他违反本协议约定或魔金平台规则的，或者其他甲方认为侵犯魔金或消费者权益的。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方未经甲方同意，擅自停止店铺经营，或者乙方因为出现<span lang=\"EN-US\">&nbsp;4.3.2&nbsp;</span>情形被甲方停止店铺服务的，乙方已缴纳的相关店铺的平台使用费未到期部分，作为乙方向甲方支付的违约金，该金额不足以冲抵乙方应付违约金和赔偿金时，乙方应另行支付差额。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第五条<span lang=\"EN-US\">&nbsp;</span>双方权利及义务</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方根据本协议向乙方提供电子商务交易平台及相应技术支持服务，尽力维护&ldquo;魔金平台&rdquo;的正常稳定运行，并努力提升和改进技术，对平台功能及服务进行更新、升级，不断提升平台性能和交易效率。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方对乙方在使用&ldquo;魔金平台&rdquo;过程中遇到的问题及提出的建议和意见积极予以回复，可依乙方需求对其使用&ldquo;魔金平台&rdquo;提供合理的指导和培训。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意甲方根据乙方营业执照所载明的经营范围及乙方申请经营的经营类目，核实及调整乙方在&ldquo;京<span lang=\"EN-US\">&nbsp;</span>东平台&rdquo;经营的具体商品的种类、数量和类目范围。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意并自愿遵守甲方根据国家相关法律法规、政策及平台运营情况，对公示于&ldquo;魔金平台&rdquo;的规则、流程、收费标准等进行更新、调整。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意甲方对乙方提供的相关资质文件及各类信息资料进行审核。甲方审核为形式审核，审核通过并不代表甲方对审核内容的真实性、合法性、准确性、及时性的确认，乙方仍须对其提交的资料的真实性、合法性、准确性、及时性等承担相应的法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权对乙方的注册信息、上传的相关数据信息、在&ldquo;魔金平台&rdquo;发布的其他信息及交易行为进行监督检查，对发现的违法违规信息及其相关内容，乙方同意甲方不经通知立即删除，对发现的其他问题或疑问有权向乙方发出询问及要求改正的通知，乙方应在接到通知后立即做出说明或改正。对乙方前述不当行为，甲方有权追究其违约、侵权责任并<span lang=\"EN-US\">/</span>或解除本协议。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权将经国家生效法律文书或行政文书确定的乙方违法违规事件，或乙方已确认的乙方违反本协议相关约定的事项，在&ldquo;魔金平台&rdquo;上予以公示；乙方多次违规或者有严重违约、违规情形的，甲方有权对其采取暂停店铺运营、扣除保证金直至终止本协议等措施，上述措施不足以补偿甲方损失的，甲方有权继续向乙方追偿。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp; &nbsp; 5.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">如乙方的运营情况不能满足&ldquo;魔金平台&rdquo;要求，经限期整改调整后，仍无法满足平台运营条件的，甲方有权解除本协议，停止向乙方提供服务。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.9&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权根据市场情况及&ldquo;魔金平台&rdquo;入驻商家经营情况组织相应的促销活动，乙方应根据自身经营<span lang=\"EN-US\">&nbsp;</span>情况及商品情况积极予以支持。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.10&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权要求乙方提供与乙方商品、售后服务等相关的信息，以便于客户直接向&ldquo;魔金平台&rdquo;客服中心进行咨询时予以回复，对于甲方无法回答或属乙方掌握的情况，甲方有权要求乙方在指定的时限内予以回复或给出相应方案，对乙方未及时解决的客户咨询及投诉，甲方有权对乙方采取相应处理措施。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">5.11&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">如因乙方商品、发布的信息或提供的售后服务问题而引发客户对甲方及<span lang=\"EN-US\">/</span>或&ldquo;魔金平台&rdquo;的诉讼，甲方及<span lang=\"EN-US\">/</span>或&ldquo;魔金平台&rdquo;有权披露乙方为实际商品提供商，乙方应承担因客户诉讼而产生的全部法律责任，如因此而给甲方及<span lang=\"EN-US\">/</span>或&ldquo;魔金平台&rdquo;造成损失的，甲方有权要求乙方赔偿甲方及&ldquo;魔金平台&rdquo;的全部损失。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.12&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意&ldquo;魔金&rdquo;根据业务调整情况将本协议项下的权利和义务部分或全部转移给甲方关联公司，但须提前<span lang=\"EN-US\">&nbsp;5&nbsp;</span>日通知乙方。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第六条<span lang=\"EN-US\">&nbsp;</span>乙方声明及保证</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证在&ldquo;魔金平台&rdquo;提交的注册资料真实、准确、合法、有效，对获得的与自设密码共同使用的魔金平台用户名（店铺用户名）妥善保管，不得擅自转让或授权他人使用，并对利用该用户名和密码所进行的一切活动负全部责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证符合本协议约定的入驻条件，保证向甲方提交的证明文件及其他相关证明真实、准确、合法、有效，并保证在上述资料发生变更时及时通知甲方，并在&ldquo;魔金平台&rdquo;上予以更新。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证其有权利订立本协议，其代理人已获得充分授权，并对代理人的行为承担法律责任，同时乙方保证对其雇员、本协议约定的联系人及其他乙方委派的履行本协议的人员的行为承担法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;6.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证遵守本协议及附件的相关约定和魔金平台相关规则及流程，在使用&ldquo;魔金平台&rdquo;相关服务时严格<span lang=\"EN-US\">&nbsp;</span>按照上述约定及规则和流程使用，不从事任何有损甲方利益的行为。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证对在&ldquo;魔金平台&rdquo;经营的商品拥有合法销售权，商品质量合格，符合国家相关质量标准，不侵犯任何第三方的合法权利，并对其商品质量及商品合法性独立承担全部法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证在&ldquo;魔金平台&rdquo;发布的商品信息真实、准确，符合魔金平台规则及国家相关法律法规的规定，与实际出售的商品一致，不含任何夸大或虚假内容，并对商品信息承担独立的完全的法律责任。若发布的上述信息变更的，乙方应及时在&ldquo;魔金平台&rdquo;予以更新。若因信息未及时变更引起法律后果的，乙方独立承担全部责任。</span></p>', '18000000001', 'http://images.lecshop.cn/20190626/1561517481852.jpg', 'http://images.lecshop.cn/20180104/1515029919503.jpg', '1', '0', '1', '<p>RYJDJYDJ</p>', NULL, NULL);
