-- Records of sms_home_new_product
-- ----------------------------

-- ----------------------------
-- Table structure for sms_home_recommend_product
-- ----------------------------
DROP TABLE IF EXISTS `sms_home_recommend_product`;
CREATE TABLE `sms_home_recommend_product`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `product_id` bigint(20) DEFAULT NULL,
  `product_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `recommend_status` int(11) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL,
  `store_id` int(11) DEFAULT 1 COMMENT '所属店铺',
  `price` decimal(10, 2) DEFAULT NULL,
  `pic` varchar(127) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 140 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '人气推荐商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sms_home_recommend_product
-- ----------------------------

-- ----------------------------
-- Table structure for sms_home_recommend_subject
-- ----------------------------
DROP TABLE IF EXISTS `sms_home_recommend_subject`;
CREATE TABLE `sms_home_recommend_subject`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `subject_id` bigint(20) DEFAULT NULL,
  `subject_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `recommend_status` int(11) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL,
  `store_id` int(11) DEFAULT 1 COMMENT '所属店铺',
  `pic` varchar(127) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `read_count` int(11) DEFAULT NULL,
  `description` varchar(127) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '首页推荐专题表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing`;
CREATE TABLE `sms_marketing`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营销名称',
  `type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '营销类型 1 直降  2 满赠 3抢购 4满减  5 满折 6 包邮 7 定金预售 8 全款预售 9 试用 10拼团 11 众筹',
  `cate_id` bigint(20) DEFAULT NULL COMMENT '促销分类id',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `desc` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营销描述',
  `starttime` timestamp(0) DEFAULT NULL COMMENT '营销开始时间\n',
  `endtime` timestamp(0) DEFAULT NULL COMMENT '营销结束时间\n营销为定金预售的时候，该时间也是第二阶段付款的时间\n营销为全款预售的时候，该时间也是发货时间',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '删除标记 0 未删除 1删除 默认0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 69 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_cate
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_cate`;
CREATE TABLE `sms_marketing_cate`  (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(124) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '分类名称',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '1 预售 2 拼团 3 试用 4 抢购  5 众筹',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 18 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销分类表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_crowdfunding
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_crowdfunding`;
CREATE TABLE `sms_marketing_crowdfunding`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) DEFAULT NULL COMMENT '促销id  对应sms_marketing表中的id',
  `money` decimal(20, 2) DEFAULT NULL COMMENT '众筹金额',
  `ship_time` timestamp(0) DEFAULT NULL COMMENT '发货时间',
  `lottery` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '1 元抽奖  0 开启 1 关闭 默认0 ',
  `lottery_num` int(11) DEFAULT NULL COMMENT '抽奖人数',
  `no_return_support` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '无回报支付 是否开启  0 开启 1 关闭 默认0 ',
  `already_money` decimal(20, 2) DEFAULT NULL COMMENT '已经筹到的金额',
  `spu_id` bigint(20) DEFAULT NULL COMMENT '商品id',
  `pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '众筹图片',
  `auto_handle_status` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '自动处理状态 0 未处理 1已处理 默认0',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '促销众筹表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_fall
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_fall`;
CREATE TABLE `sms_marketing_fall`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) NOT NULL COMMENT '营销id',
  `price` decimal(20, 2) NOT NULL COMMENT '直降的价格',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销直降表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_freeship
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_freeship`;
CREATE TABLE `sms_marketing_freeship`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) NOT NULL COMMENT '营销id',
  `full_price` decimal(20, 2) NOT NULL COMMENT '包邮满的价格',
  `is_use` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '包邮促销是否启用 0 不启用  1 启用 默认0 ',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销包邮表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_full_discount
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_full_discount`;
CREATE TABLE `sms_marketing_full_discount`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) NOT NULL COMMENT '营销id',
  `full_price` decimal(20, 2) NOT NULL COMMENT '满多少钱',
