  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销满折表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_full_down
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_full_down`;
CREATE TABLE `sms_marketing_full_down`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) NOT NULL COMMENT '营销id',
  `full_price` decimal(20, 2) NOT NULL COMMENT '满多少钱',
  `price` decimal(20, 2) DEFAULT NULL COMMENT '减多少钱',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 22 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销满减表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_full_gift
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_full_gift`;
CREATE TABLE `sms_marketing_full_gift`  (
