  `full_price` decimal(20, 2) NOT NULL COMMENT '满多少钱',
  `sku_infos` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '赠送的单品信息格式为\n[{skuId:’1’,num:1},{skuId:’2’,num:2}]  json数组',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销满赠表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_group
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_group`;
CREATE TABLE `sms_marketing_group`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) DEFAULT NULL COMMENT '促销id',
