  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 40 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '拼团详情' ROW_FORMAT = Dynamic;

-- ----------------------------
