CREATE TABLE `sms_marketing_pic`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `pc_pic` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端的图片',
  `mobile_pic` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端图片',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '促销类型 1 折扣 2 预售 3 拼团 4 试用',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '促销图片' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_presale
