  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预售类型 1 定金预售 2 全款预售',
  `deposit_pre` decimal(10, 2) DEFAULT NULL COMMENT '定金百分比',
  `skuid` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT ' 单品id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 49 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营销预售表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_presale_show
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_presale_show`;
CREATE TABLE `sms_marketing_presale_show`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `presale_id` bigint(20) DEFAULT NULL COMMENT '预售id对应ls_marketing_presale表中的id',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `sort` int(11) DEFAULT 1 COMMENT '排序',
  `cate_id` bigint(20) DEFAULT -1 COMMENT '分类id对应ls_marleting_cate表中的id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记  0 未删除 1 已删除 默认0 ',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `presale_id`(`presale_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '预售显示表用于c端的展示' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_setting
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_setting`;
CREATE TABLE `sms_marketing_setting`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `pc_panic_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端抢购图片',
  `mobile_panic_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端抢购图片',
  `pc_presale_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端预售图片',
  `mobile_presale_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端预售图片',
  `pc_try_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端试用图片',
  `mobile_try_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端试用图片',
  `pc_point_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端积分图片',
  `mobile_point_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端积分图片',
  `pc_red_envelope_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端红包图片',
  `mobile_group_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端拼团图片',
  `pc_crowdfunding_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'pc端众筹图片',
  `mobile_crowdfunding_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动端众筹图片',
  `try_rule` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '试用规则',
  `pre_sale_rule` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预售规则',
  `crowdfunding_rule` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '众筹规则说明',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '促销设置表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_try
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_try`;
CREATE TABLE `sms_marketing_try`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) DEFAULT NULL COMMENT '促销id',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '0元试用类型 1 付邮试用 2 返卷试用',
  `try_num` int(11) DEFAULT NULL COMMENT '提供商品试用的份数',
  `apply_num` int(11) DEFAULT NULL COMMENT '可以申请的人数 为0 表示不限制人数',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '优惠卷的id（类型为返卷试用的时候使用）',
  `alerdy_apply_num` bigint(20) DEFAULT 0 COMMENT '已经申请的试用人数',
  `has_audit` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否有过审核，0 没有过 1 审核过 默认0 ',
  `sku_info` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '单品信息',
  `skuid` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `marketing_id`(`marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 55 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '0元试用促销表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_marketing_try_show
-- ----------------------------
DROP TABLE IF EXISTS `sms_marketing_try_show`;
CREATE TABLE `sms_marketing_try_show`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `try_id` bigint(20) DEFAULT NULL COMMENT '试用id对应ls_marketing_try表中的id',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `sort` int(11) DEFAULT 1 COMMENT '排序',
  `cate_id` bigint(20) DEFAULT -1 COMMENT '分类id对应ls_marleting_cate表中的id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记  0 未删除 1 已删除 默认0 ',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `try_id`(`try_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '试用显示表用于c端的展示' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_point_cate
-- ----------------------------
DROP TABLE IF EXISTS `sms_point_cate`;
CREATE TABLE `sms_point_cate`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '积分商城分类',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '分类名称',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1 已删除  默认0 ',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分商城分类表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sms_point_cate
-- ----------------------------

-- ----------------------------
-- Table structure for sms_point_order
-- ----------------------------
DROP TABLE IF EXISTS `sms_point_order`;
CREATE TABLE `sms_point_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `sku_id` bigint(20) DEFAULT NULL COMMENT '积分商品id',
  `num` int(11) DEFAULT NULL COMMENT '购买的数量',
  `code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单号',
  `receiver` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人',
  `mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
  `phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '固定电话',
  `zip_code` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮编',
  `address` varchar(124) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货地址  省市区＋详细地址',
  `point` int(11) DEFAULT NULL COMMENT '积分',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '0 待发货，1 已发货，待用户收货 2 用户已收货，订单完成',
  `logistics_companyname` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '物流公司名称',
  `logistics_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '运单号',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `delivery_time` timestamp(0) DEFAULT NULL COMMENT '发货时间',
  `receipt_time` timestamp(0) DEFAULT NULL COMMENT '确认收货时间',
  `sku_info` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分商品信息  json格式',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分商城订单' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_point_setting
-- ----------------------------
DROP TABLE IF EXISTS `sms_point_setting`;
CREATE TABLE `sms_point_setting`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `is_open` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '是否开启 0未开启 1开启 默认0未开启',
  `email_point` int(11) DEFAULT NULL COMMENT '邮箱验证积分（只有第一次验证的时候赠送）',
  `comment_point` int(11) DEFAULT NULL COMMENT '发表评论赠送积分',
  `use_point` int(11) DEFAULT NULL COMMENT '使用多少积分',
  `offset_money` int(11) DEFAULT NULL COMMENT '低多少元',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分设置表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_point_sign_rule
-- ----------------------------
DROP TABLE IF EXISTS `sms_point_sign_rule`;
CREATE TABLE `sms_point_sign_rule`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '是否开启 0 开启  1 不开启 默认0 ',
  `rule` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '签到规则',
  `title` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '标题',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分签到规则' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_point_sku
-- ----------------------------
DROP TABLE IF EXISTS `sms_point_sku`;
CREATE TABLE `sms_point_sku`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分商品名称',
  `sub_title` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分商品副标题',
  `code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分商品编号',
  `point` int(11) DEFAULT NULL COMMENT '商品所需的积分',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '发布状态 0 未发布 1 发布 ',
  `price` decimal(20, 2) DEFAULT NULL COMMENT '价格',
  `stock` int(11) DEFAULT NULL COMMENT '库存',
  `cate_id` bigint(20) DEFAULT NULL COMMENT '积分商品分类id',
  `pics` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分商品图片  多个图片用，分割',
  `desc` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '描述',
  `mobile_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '移动端描述',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记 0 未删 1 已删除',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间	',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_red_envelope
-- ----------------------------
DROP TABLE IF EXISTS `sms_red_envelope`;
CREATE TABLE `sms_red_envelope`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包名称',
  `num` int(11) DEFAULT NULL COMMENT '生成红包的个数',
  `limit_num` int(11) DEFAULT NULL COMMENT '没人可以领取的红包数量',
  `desc` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '描述',
  `signuptime` timestamp(0) DEFAULT NULL COMMENT '店铺报名截止时间',
  `starttime` timestamp(0) DEFAULT NULL COMMENT '开始时间',
  `endtime` timestamp(0) DEFAULT NULL COMMENT '结束时间',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1 删除 默认0 ',
  `full_price` decimal(20, 2) DEFAULT NULL COMMENT '满多少钱',
  `price` decimal(20, 2) DEFAULT NULL COMMENT '减多少钱',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '红包是否已领完 0 否  1 是  默认0 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '平台红包表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_red_envelope_code
-- ----------------------------
DROP TABLE IF EXISTS `sms_red_envelope_code`;
CREATE TABLE `sms_red_envelope_code`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `red_envelope_id` bigint(20) DEFAULT NULL COMMENT '红包id',
  `code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包的卷码',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '领取红包的会员id',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包卷状态  0 未领取 1已领取未使用 2 已使用 3已失效',
  `receive_time` timestamp(0) DEFAULT NULL COMMENT '领取时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `red_envelope_id`(`red_envelope_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11229 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '红包卷码表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_red_envelope_store
-- ----------------------------
DROP TABLE IF EXISTS `sms_red_envelope_store`;
CREATE TABLE `sms_red_envelope_store`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `red_envelope_id` bigint(20) NOT NULL COMMENT '红包id',
  `store_id` bigint(20) NOT NULL COMMENT '店铺id',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '红包申请的店铺' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_register_marketing
-- ----------------------------
DROP TABLE IF EXISTS `sms_register_marketing`;
CREATE TABLE `sms_register_marketing`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `is_use` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '是否开启  0未开启 1开启 默认0',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '送优惠卷的id',
  `point_num` int(11) DEFAULT NULL COMMENT '送积分的数量',
  `starttime` timestamp(0) DEFAULT NULL COMMENT '开始时间',
  `endtime` timestamp(0) DEFAULT NULL COMMENT '结束时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '注册营销表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_seckill_scene
-- ----------------------------
DROP TABLE IF EXISTS `sms_seckill_scene`;
CREATE TABLE `sms_seckill_scene`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `seckill_time` timestamp(0) DEFAULT NULL COMMENT '秒杀时间 年月日时',
  `scene` int(1) DEFAULT NULL COMMENT '场次 0-23',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记 0 未删除 1 已删除',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `seckill_time`(`seckill_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '秒杀场次' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_seckill_scene_panicbuy
-- ----------------------------
DROP TABLE IF EXISTS `sms_seckill_scene_panicbuy`;
CREATE TABLE `sms_seckill_scene_panicbuy`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `seckill_scene_id` bigint(20) DEFAULT NULL COMMENT '秒杀场次的id 对应sms_seckill_scene表中的id',
  `panicbuy_id` bigint(20) DEFAULT NULL COMMENT '折扣促销id 对应sms_marketing_panicbuy表中的id',
  `marketing_id` bigint(20) DEFAULT NULL COMMENT '促销的id 对应sms_marketing表中的id',
  `sort` int(11) DEFAULT 1 COMMENT '排序',
  `seckill_time` timestamp(0) DEFAULT NULL COMMENT '秒杀时间  该字段是冗余字段',
  `is_show` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否显示  0 不显示 1 显示 默认0 ',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记 0 未删除 1 已删除',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `seckill_scene_id`(`seckill_scene_id`) USING BTREE,
  INDEX `panicbuy_id`(`panicbuy_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '秒杀场次下面的商品' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_seckill_secene_store
-- ----------------------------
DROP TABLE IF EXISTS `sms_seckill_secene_store`;
CREATE TABLE `sms_seckill_secene_store`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `seckill_scene_id` bigint(20) DEFAULT NULL COMMENT '秒杀场次的id 对应sms_seckill_scene表中的id',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记 0 未删除 1 已删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺参与秒杀活动的关联表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_try_report
-- ----------------------------
DROP TABLE IF EXISTS `sms_try_report`;
CREATE TABLE `sms_try_report`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `try_apply_id` bigint(20) DEFAULT NULL COMMENT '试用申请id',
  `satisfaction` int(11) DEFAULT NULL COMMENT '满意度 1到5分',
  `advice` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '亮点和建议',
  `feel` varchar(1204) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '试用感受',
  `pics` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图片 多个图片用,分割',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '1' COMMENT '审核状态 1：已审核，0未审核，默认1',
  `submit_time` datetime(0) DEFAULT NULL COMMENT '提交时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '试用报告表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sms_trysku_apply
-- ----------------------------
DROP TABLE IF EXISTS `sms_trysku_apply`;
CREATE TABLE `sms_trysku_apply`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `marketing_id` bigint(20) NOT NULL COMMENT '促销id（申请）',
  `sku_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '试用商品的商品id',
  `order_id` bigint(20) DEFAULT NULL COMMENT '试用对应的订单id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '状态  0 试用申请中  1 申请通过 2 申请拒绝 3下单成功\n4 已完成（已提交试用报告）',
  `apply_time` timestamp(0) DEFAULT NULL COMMENT '申请时间',
  `try_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `marketing_id`(`marketing_id`, `customer_id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品申请试用列表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sys_config
-- ----------------------------
DROP TABLE IF EXISTS `sys_config`;
CREATE TABLE `sys_config`  (
  `config_id` int(5) NOT NULL AUTO_INCREMENT COMMENT '参数主键',
  `config_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '参数名称',
  `config_key` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '参数键名',
  `config_value` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '参数键值',
  `config_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT 'N' COMMENT '系统内置（Y是 N否）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`config_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '参数配置表' ROW_FORMAT = Dynamic;

