-- Records of sys_user_role
-- ----------------------------

-- ----------------------------
-- Table structure for t_attention_store
-- ----------------------------
DROP TABLE IF EXISTS `t_attention_store`;
CREATE TABLE `t_attention_store`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `store_id` bigint(20) NOT NULL COMMENT '店铺id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '删除标记 0 未删除 1 删除',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customerId`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 24 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺关注' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_complaints
-- ----------------------------
DROP TABLE IF EXISTS `t_complaints`;
CREATE TABLE `t_complaints`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `complaints_desc` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '投诉描述',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '0未处理 1 已处理',
  `complaints_replay` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '投诉回复',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `operator` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '操作人',
  `type` int(255) DEFAULT NULL COMMENT '1功能建议 2BUG反馈 3业务咨询',
  `pics` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `mobile` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '平台投诉表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_complaints_order
-- ----------------------------
DROP TABLE IF EXISTS `t_complaints_order`;
CREATE TABLE `t_complaints_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `order_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单号',
  `complaints_type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单投诉类型  1 产品相关 2价格相关 3服务相关 4物流相关 5售后相关 6财务相关 7活动相关 8网站相关 9 预约相关 10其他方面',
  `complaints_desc` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '投诉描述',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '状态 0 未处理  1 已处理',
  `complaints_replay` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '投诉回复',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `operator` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '操作人',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单投诉表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_live_info
-- ----------------------------
DROP TABLE IF EXISTS `t_live_info`;
CREATE TABLE `t_live_info`  (
  `roomid` int(11) NOT NULL,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '名称',
  `cover_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '背景图',
  `share_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '分享图',
  `live_status` int(10) DEFAULT NULL COMMENT '直播间状态。101：直播中，102：未开始，103已结束，104禁播，105：暂停，106：异常，107：已过期',
  `start_time` bigint(20) DEFAULT NULL COMMENT '直播间开始时间',
  `end_time` bigint(20) DEFAULT NULL COMMENT '直播计划结束时间',
  `anchor_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主播名',
  `create_time` datetime(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`roomid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_step_data
-- ----------------------------
DROP TABLE IF EXISTS `t_step_data`;
CREATE TABLE `t_step_data`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(11) DEFAULT NULL COMMENT '用户编号',
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '昵称',
  `step` bigint(255) DEFAULT NULL COMMENT '步数',
  `create_date` datetime(0) DEFAULT NULL COMMENT '创建时间',
  `data` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '日期',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2740 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_authority
-- ----------------------------
DROP TABLE IF EXISTS `t_store_authority`;
CREATE TABLE `t_store_authority`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限的名称',
  `url` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限对应的访问地址',
  `parentId` bigint(20) NOT NULL COMMENT '父级id 如果是第一级  则为0',
  `grade` int(11) NOT NULL COMMENT '级别 1 表示第一级 2表示第二级',
  `sort` int(11) DEFAULT NULL COMMENT '排序 数字越低 排序越前',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `image` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图片地址',
  `component` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '前端页面对于的组件地址',
  `redirect` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '重定向地址',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '类型 0 菜单 1 接口',
  `active_menu` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '当前节点激活的菜单（一般这个节点是一个详情页面，自己本身没有左侧菜单）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 606 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺的权限资源表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of t_store_authority
-- ----------------------------

-- ----------------------------
-- Table structure for t_store_billing_records
-- ----------------------------
DROP TABLE IF EXISTS `t_store_billing_records`;
CREATE TABLE `t_store_billing_records`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单code',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '账单进出类型 0 进 1 出',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `store_name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '店铺名称',
  `record_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '账单记录类型 1 提货完成 2 代客下单完成',
  `order_price` decimal(20, 2) DEFAULT NULL COMMENT '订单价格',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '结算状态 0 未结算 1 已结算 默认0 ',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店账单收入支出表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_category
-- ----------------------------
DROP TABLE IF EXISTS `t_store_category`;
CREATE TABLE `t_store_category`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '分类名称',
  `parent_id` bigint(20) NOT NULL COMMENT '上级分类id 0 表示没有上级',
  `grade` int(11) NOT NULL COMMENT '1 一级分类 2 二级分类 3 三级分类',
  `sort` int(11) DEFAULT NULL COMMENT '排序  数值越小 越靠前',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记  0 未删除 1 删除',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺分类' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_comment
-- ----------------------------
DROP TABLE IF EXISTS `t_store_comment`;
CREATE TABLE `t_store_comment`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `store_id` bigint(20) NOT NULL COMMENT '店铺id',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单号',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `desc_score` int(11) DEFAULT NULL COMMENT '描述相符 评分1到5分',
  `seller_score` int(11) DEFAULT NULL COMMENT '卖家服务评分 1到5分',
  `logistics_score` int(11) DEFAULT NULL COMMENT '物流评分 1到5分',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺评论表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_customize_brand
-- ----------------------------
DROP TABLE IF EXISTS `t_store_customize_brand`;
CREATE TABLE `t_store_customize_brand`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '品牌名称',
  `url` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '品牌的图片',
  `certificat_url` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '证书图片',
  `store_id` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '店铺id',
  `brand_id` bigint(20) DEFAULT NULL COMMENT '对应品牌表中的id',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '状态  0 申请中  1通过 2 拒绝',
  `reason` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '拒绝原因',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记  0 未删除 1 删除默认0 ',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺自定义品牌列表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_evaluation
-- ----------------------------
DROP TABLE IF EXISTS `t_store_evaluation`;
CREATE TABLE `t_store_evaluation`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `score` int(11) DEFAULT NULL COMMENT '门店评分',
  `desc` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '评价',
  `order_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单code',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店评价表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_info
-- ----------------------------
DROP TABLE IF EXISTS `t_store_info`;
CREATE TABLE `t_store_info`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `store_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '店铺名称',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '店铺状态\n0 填写资料中 \n1 店铺审核中\n2 审核通过\n3 审核不通过\n4 店铺关闭',
  `company_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司名称',
  `company_address` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司地址',
  `company_phone` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司电话',
  `company_email` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司邮箱',
  `contact_person` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '联系人',
  `contact_phone` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '联系人电话',
  `legal_person` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '法定代表人',
  `card_no` varchar(24) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '身份证号码',
  `card_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '身份证照片',
  `bus_licenec` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营业执照号',
  `bus_licenec_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营业执照图片',
  `business_scope` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '经营范围',
  `org_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '组织机构代码图片',
  `tax_pic` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '税务登记图片',
  `bank_user_name` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '银行开户名',
  `bank_account` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司银行账号',
  `bank_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '开户银行支行名称',
  `bank_number` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '支行银行号',
  `bank_address` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '开户银行所在地',
  `bank_pic` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '开户银行许可证电子版',
  `billing_cycle` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '结算周期',
  `ismerge` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '0三证合一 1 三证不合一',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1 删除 默认0 ',
  `service_qq` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '客服QQ',
  `reason` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '拒绝原因',
  `ave_score` decimal(10, 2) DEFAULT NULL COMMENT '店铺评分',
  `effective_time` timestamp(0) DEFAULT NULL COMMENT '店铺有效期',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '店铺类型 0 普通店铺 1 加盟 2连锁',
  `longitude` decimal(15, 10) DEFAULT NULL COMMENT '经度',
  `latitude` decimal(15, 10) DEFAULT NULL COMMENT '纬度',
  `business_time` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营业时间',
  `bus_routes` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公交线路',
  `avatar_picture` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '店铺头像',
  `province_id` bigint(20) DEFAULT NULL COMMENT '省id',
  `city_id` bigint(20) DEFAULT NULL COMMENT '市id',
  `district_id` bigint(20) DEFAULT NULL COMMENT '区域id',
  `company_detail_address` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公司详细地址',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 55 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_order
-- ----------------------------
DROP TABLE IF EXISTS `t_store_order`;
CREATE TABLE `t_store_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单编号',
  `master_order_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '主订单code  下单可能会同时下多个订单 ，一个master_order_code 可以对应多个order_code 即多个订单',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `original_price` decimal(20, 2) DEFAULT NULL COMMENT '订单的原始价格',
  `price` decimal(20, 2) DEFAULT NULL COMMENT '订单的最终价格(订单的最终成交价格)（原始价格-红包的价格）',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单状态 1 待付款（刚下单） 2 待取货（已经付款） 3 交易完成  4 取消订单',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `evaluation_status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '评价状态  0 未评价 1 已评价  默认为0 未评价',
  `red_envelope_price` decimal(20, 2) DEFAULT NULL COMMENT '使用红包减去的金额',
  `red_envelope_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包的卷码',
  `write_off_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '核销码',
  `source` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单来源 1pc  2 h5   3 app 4 代客下单',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `pay_time` timestamp(0) DEFAULT NULL COMMENT '支付时间',
  `cancel_time` timestamp(0) DEFAULT NULL COMMENT '取消时间',
  `cancel_reason` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单取消原因 1 现在不想买 2商品价格较贵 3价格波动 4商品缺货 5 重复下单 6发票信息有误 7 其他原因 8 无法备齐货物 9不是有效订单 10 买家主动要求',
  `pick_up_time` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '取货时间',
  `real_pick_up_time` timestamp(0) DEFAULT NULL COMMENT '实际取货时间',
  `pay_type` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '支付类型',
  `predeposit_pay` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否是预存款支付  0否1 是 默认0 ',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店订单' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_order_attr
-- ----------------------------
DROP TABLE IF EXISTS `t_store_order_attr`;
CREATE TABLE `t_store_order_attr`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `invoice_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '发票类型  0 不需要发票 1普通发票 2增值税发票 默认0',
  `invoice_title` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '发票抬头',
  `invoice_content` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '发票内容 \\n1:非图书商品\\n2:明细\\n3:耗材\\n4:办公用品',
  `invoice_taxid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '税号',
  `remark` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '订单备注',
  `invoice_title_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '抬头类型  1 企业  2 个人',
  `invoice_company_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单位名称',
  `invoice_register_address` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '注册地址',
  `invoice_register_mobile` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '注册电话',
  `invoice_open_bank` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '开户银行',
  `invoice_bank_account` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '银行账户',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店订单附属信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_order_operation_log
-- ----------------------------
DROP TABLE IF EXISTS `t_store_order_operation_log`;
CREATE TABLE `t_store_order_operation_log`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_id` bigint(20) NOT NULL COMMENT '门店订单id 对应t_store_order 表中的id',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '操作类型 1 确认付款 2 核销（提货） 3 取消订单 ',
  `remark` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '说明',
  `operation_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '操作人',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店订单操作日志' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_order_sku
-- ----------------------------
DROP TABLE IF EXISTS `t_store_order_sku`;
CREATE TABLE `t_store_order_sku`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `sku_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单品id',
  `num` int(11) DEFAULT NULL COMMENT '购买的数量',
  `price` decimal(20, 2) DEFAULT NULL COMMENT '单品的最终价格（原价－优惠价）',
  `sku_price` decimal(20, 2) DEFAULT NULL COMMENT '单品的价格',
  `sku_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单品的名称',
  `sku_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单品的id',
  `sku_image` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单品的图片',
  `sku_specs` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单品的规格',
  `red_envelope_price` decimal(20, 2) DEFAULT NULL COMMENT '红包减去的价格',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店订单单品信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_store_paytype
