-- ----------------------------
-- Table structure for t_store_red_envelope_code
-- ----------------------------
DROP TABLE IF EXISTS `t_store_red_envelope_code`;
CREATE TABLE `t_store_red_envelope_code`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `red_envelope_id` bigint(20) DEFAULT NULL COMMENT '门店红包id',
  `code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包的卷码',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '领取红包的会员id',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '红包卷状态  0 未领取 1已领取未使用 2 已使用 3已失效',
  `receive_time` timestamp(0) DEFAULT NULL COMMENT '领取红包',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '门店红包卷吗表' ROW_FORMAT = Dynamic;

-- ----------------------------
