-- ----------------------------
-- Table structure for t_store_template
-- ----------------------------
DROP TABLE IF EXISTS `t_store_template`;
CREATE TABLE `t_store_template`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '模板名称',
  `template` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '编辑模版的json数据',
  `release_template` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '发布模版的json数据',
  `is_use` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否使用  \'1\'使用 默认\'0\' ',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 \'1\' 删除  默认 \'0\'',
  `update_time` datetime(0) DEFAULT NULL COMMENT '更新时间',
  `release_time` datetime(0) DEFAULT NULL COMMENT '发布时间',
  `store_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `store_id`(`store_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺首页模板表' ROW_FORMAT = Dynamic;

