  `sku_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '单品id',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记  0 未删除 1 删除',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1469 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员浏览记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_member
-- ----------------------------
DROP TABLE IF EXISTS `ums_member`;
CREATE TABLE `ums_member`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `username` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '用户名',
  `password` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户密码',
  `nickname` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '昵称',
  `image` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '头像地址',
  `relename` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '真实姓名',
  `cardid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '身份证',
  `gender` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '性别  0 保密 1男 2女 默认0',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `monthly_income` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '月收入  0 无收入 1 2000以下 2 2000-3999 3 4000-5999\n4 6000－7999  5 8000以上',
  `marriage_status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '婚姻状况  0 保密 1未婚 2 已婚 默认0 保姆',
  `mobile` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
  `email` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮箱地址',
  `modified_email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '更改中的邮箱（绑定新邮箱使用）',
  `check_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '校验码（绑定新邮箱时使用）',
  `province` bigint(20) DEFAULT NULL COMMENT '省',
  `city` bigint(20) DEFAULT NULL COMMENT '市',
  `county` bigint(20) DEFAULT NULL COMMENT '区',
  `detailaddress` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '详细地址',
  `interest` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '兴趣爱好',
  `store_id` bigint(20) DEFAULT 0 COMMENT '店铺id  平台的为0  默认为平台',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '1 普通用户 2 商家店铺用户 3 店铺员工',
  `consumption_amount` decimal(20, 2) DEFAULT NULL COMMENT '总的消费金额',
  `paypassword` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预存款支付密码',
  `source` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '用户注册来源 1 pc  2app  3 手机h5 4 管理员后台新增\n',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '1' COMMENT '用户状态 1 正常 2 冻结  3 未启用 默认1 ',
  `sign_num` int(11) DEFAULT 0 COMMENT '会员签到次数',
  `is_mobile_verification` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '手机是否验证  0 否 1 验证 默认0 ',
  `is_email_verification` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '邮箱是否验证   0 否 1 验证  默认0  ',
  `login_error_count` int(11) DEFAULT NULL COMMENT '错误登录的次数',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1删除 默认0 ',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  `lock_time` timestamp(0) DEFAULT NULL COMMENT '锁定时间',
  `last_login_time` timestamp(0) DEFAULT NULL COMMENT '最近登陆时间',
  `recommended` bigint(20) DEFAULT -1 COMMENT '推荐人的会员id  如果没有 则为-1  默认为-1',
  `s_recommended` bigint(20) DEFAULT -1 COMMENT '二级推荐人的会员id （上级的上级） 如果没有 则为-1  默认为-1',
  `self_recommend_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '会员自己的推荐码',
  `commission` decimal(20, 2) DEFAULT 0.00 COMMENT '会员的佣金',
  `belone_store_id` bigint(20) DEFAULT 0 COMMENT '会员所属的店铺id',
  `applet_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `app_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `h5_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1080 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '会员表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_member_address
-- ----------------------------
DROP TABLE IF EXISTS `ums_member_address`;
CREATE TABLE `ums_member_address`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '用户id  对应ums_member表中的id',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人姓名',
  `mobile` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
  `phone` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人固定电话',
  `zip_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮编',
  `address` varchar(124) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人地址（省＋市＋区）',
  `detail_address` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人详细地址',
  `province_id` bigint(20) DEFAULT NULL COMMENT '省id',
  `city_id` bigint(20) DEFAULT NULL COMMENT '市id',
  `country_id` bigint(20) DEFAULT NULL COMMENT '区id',
  `is_default` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否默认收货地址  0 否 1 是  默认0 ',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记  0 未删除 1 删除',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  `update_time` timestamp(0) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 131 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户收货地址' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_member_level
-- ----------------------------
DROP TABLE IF EXISTS `ums_member_level`;
CREATE TABLE `ums_member_level`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '会员等级名称',
  `min_money` int(11) DEFAULT NULL COMMENT '消费小值（包含该值）',
  `max_money` int(11) DEFAULT NULL COMMENT '消费金额最大值 不包含该值',
  `discount` decimal(10, 2) DEFAULT NULL COMMENT '会员折扣',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1删除 默认0',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp(0) DEFAULT NULL COMMENT '修改时间',
  `del_time` timestamp(0) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员等级表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_member_panic_record
-- ----------------------------
DROP TABLE IF EXISTS `ums_member_panic_record`;
CREATE TABLE `ums_member_panic_record`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `marketing_id` bigint(20) NOT NULL COMMENT '抢购id 注意是对应sms_marketing_panicbuy表中的id',
  `use_num` int(11) DEFAULT NULL COMMENT '用户已经购买抢购的数量',
  `panic_num` int(11) DEFAULT NULL COMMENT '该抢购的会员限购数量',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unique`(`customer_id`, `marketing_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户抢购记录表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_member_point
-- ----------------------------
DROP TABLE IF EXISTS `ums_member_point`;
CREATE TABLE `ums_member_point`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `detail` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分详细',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分类型 1 收入 2支出',
  `source_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '积分纪录来源类型\n1 订单使用\n2 订单取消\n3 操作员修改\n4 签到\n5 积分商城使用\n6 邮箱验证 \n7 评论\n',
  `point` int(11) DEFAULT NULL COMMENT '积分数量 正数表示增加，负数表示减少',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `sign_data` date DEFAULT NULL COMMENT '签到时间，用于防止重复签到',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `sign_unique`(`customer_id`, `source_type`, `sign_data`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 940 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员积分详情表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_pre_deposit_record
-- ----------------------------
DROP TABLE IF EXISTS `ums_pre_deposit_record`;
CREATE TABLE `ums_pre_deposit_record`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) NOT NULL COMMENT '会员id',
  `trans_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '交易类型  1:在线充值  2:订单消费  3:订单退款 4:管理员增加 5:管理员减少',
  `money` decimal(20, 2) DEFAULT NULL COMMENT '金额',
  `current_money` decimal(20, 2) DEFAULT NULL COMMENT '当前总金额',
  `remark` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '充值支付状态 0 未支付 1 支付成功',
  `transcode` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '交易号',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 300 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员预存款记录表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for ums_withdraw
-- ----------------------------
DROP TABLE IF EXISTS `ums_withdraw`;
CREATE TABLE `ums_withdraw`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '会员id',
  `money` decimal(20, 2) DEFAULT NULL COMMENT '提现金额',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '状态 0 申请  1 审核通过 2 拒绝 3 已打款',
  `trade_no` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '流水号',
  `account` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '支付宝账号',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '支付宝姓名',
  `create_time` timestamp(0) DEFAULT NULL COMMENT '创建时间',
  `paying_time` timestamp(0) DEFAULT NULL COMMENT '打款时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '提现记录表' ROW_FORMAT = Dynamic;

SET FOREIGN_KEY_CHECKS = 1;
